var request = require('request');

class Requests {
  constructor(name: string, year: number) {
    console.log(name, year)
  }

  create_request() {
    request('localhost:5000', (err: string, response: any, body: any) => {
      if (!err && response.statusCode === 200) {
        return body;
      }
    })
  }
}

export default Requests
